import React from 'react';

const Header = () => {
  const features = [
    { text: "Free Delivery", subtext: "From all orders over $10" },
    { text: "Support 24/7", subtext: "Shop with an expert" },
    { text: "Gift voucher", subtext: "Refer a friend" },
    { text: "Return & Refund", subtext: "Free return over $200" },
    { text: "Secure payment", subtext: "100% Protected" },
  ];

  return (
    <header className="bg-white shadow-md">
      <div className="bg-white shadow-md flex justify-between items-center">
        <div className='flex justify-center items-center'>
          <div className="text-left relative text-[12px] font-normal font-['Rosario-Regular',sans-serif] text-[rgba(66,90,139,0.93)] underline"> Contact </div>
          <div className="text-left relative text-[12px] font-normal font-['Rosario-Regular',sans-serif] text-[rgba(66,90,139,0.93)] underline">About Us</div>
        </div>
        <div className="container mx-auto px-4 py-4 flex justify-between items-center">
          <span>
            <span class="free-shipping-for-all-orders-over-75-00-span">
              Free shipping for all orders over
            </span>
            <span class="free-shipping-for-all-orders-over-75-00-span2">$75.00</span>
          </span>
        </div>
        <div class="register">Register</div>
      </div>

    </header>
  );
};

export default Header;  // Ensure this line is present
